import React from 'react';
import PropTypes from 'prop-types';
import './Display.css';

export default class Display extends React.Component {
    static propTypes = {
        value: PropTypes.func,
    }

    render() {
        return (
            <div className='component-display'>
                <div>{this.props.value}</div>
            </div>
        );
    }
}
